from neo4j.v1 import GraphDatabase

class Neo4JConnection(object):

    def __init__(self, uri, user, password):
        self._driver = GraphDatabase.driver(uri, auth=(user, password))

    def close(self):
        self._driver.close()


    def create_patology(self,id,nome):
        with self._driver.session() as session:
            return session.run("CREATE (p:Patologia) " 
                            " SET p.id = $id , p.nome = $nome  RETURN id(p)",id = id, nome=nome).single().value()

    def create_principio_ativo(self,nome):
        with self._driver.session() as session:
            return session.run("CREATE (p:ItemPrincipioAtivo {nome:$nome}) RETURN id(p)", nome=nome).single().value()

    def create_relationship_principio_ativo_patologia(self,nome_patologia,nome_principio_ativo,term_frequency):
        with self._driver.session() as session:
            return session.run("MATCH (p:Patologia),(i:ItemPrincipioAtivo) "
                            "WHERE p.nome = $patologia and  i.nome = $principio_ativo "
                            "CREATE (i)-[r:RELTYPE { nome: p.nome + '<->' + i.nome , freq: $frequency }]->(p) RETURN type(r), r.nome", patologia=nome_patologia, principio_ativo= nome_principio_ativo,frequency = term_frequency)

    def delete_all(self):
        with self._driver.session() as session:
            return session.run("MATCH (n) DETACH DELETE n").single()
